import React from "react"
import {SlideData} from "./SlideShowData"

function SlideShow(){
    return(
        <div>
            {SlideData.map((slide, index) => {
                return(
                    <div key = {index}>
                        <img src={slide.image} alt="controllers" className = "slideImages"/>
                    </div>
                )
            })}
        </div>
    )
}

export default SlideShow
